window.bookSummaryJSON = "<p>Androids used to mingle among us, pretending to be human. Then an alien puppet-master altered their programming. Unknown to us, androids began leaving human society, burning their clothes and peeling off their skin to reveal the chrome-colored bodies underneath.</p> <p>They gathered in a system were a star had exploded, blowing away the atmosphere of a Jupiter-like planet. The supernova had hurled heavy metals against the remaining core. The androids are mining supermetals that can turn ordinary ship weapons and shields into invincible armaments.</p> <p>The altered programming includes human genocide, which will start with a murderous attack on Earth.</p> <p>Luckily, Captain Maddox finds the enemy system. But during a space battle, something happens to hurl Victory thousands of light-years away into the Scutum-Centaurus Spiral Arm. The crippled starship will take years to reach home again. Long before that, Earth will be a radioactive ruin.</p> <p>Now begins a desperate journey in hostile space that will stretch everyone as Maddox strains to reach the Lord High Admiral in time with knowledge about the coming android attack.</p> <p><i>The Lost Supernova</i> is the tenth book in the Lost Starship Series.</p>"; 
